INSERT INTO `COMMUNITY_PAGES` VALUES (1416, 'Diabetic', '', 'SPECIAL_CASES', 'Diabetic', 1, '/diabetic-matrimony-matrimonials', 'Y', 'L1_SP_1416', 'According to the World Health Statistics 2012 Report one in 20 individual in India is diabetic making it maximum number of diabetic people in the world. Though with rising awareness in the society, wrong notions are dispelling yet many diabetic persons face matrimonial problems. A diabetic person does not find a partner for getting married. Diabetes, Type 1 and 2, is treatable with insulin and medications. Find likeminded people interested in diabetic matrimony', 'Diabetic Matrimony - Diabetic Matrimonial - Diabetic Matrimonials - Diabetic Marriage - Online Diabetic Matrimonials - Matrimonial Services', 'Search Diabetic Matrimony, Diabetic Matrimonial, Diabetic Matrimonials, Diabetic Marriage, Diabetic Matrimonial Profiles in the leading Diabetic Matrimonials site for Indian and NRI Diabetic Marriage. Join Free & Add your Diabetic Matrimonial Profile Now! Find suitable Indian & NRI Diabetic brides and grooms from our online Diabetic matrimonial and matchmaking services.', 'Diabetic matrimony, Diabetic matrimonials, Diabetic matrimonial, matrimonials, matrimony, matrimony services, online Diabetic matrimonials, Indian marriage, match making, matchmaker, Diabetic profiles, marriage bureau , Diabetic marriage bureau, matchmaking services, matrimonial profiles, Diabetic bride, Diabetic groom, matrimony classified, brides, grooms', 'Diabetic Matrimonials', 'Y', 'diabetic-matrimonials.jpg', 'Diabetic Matrimony', 'N');
INSERT INTO `COMMUNITY_PAGES` VALUES (1415, 'Cancer Survivor', '', 'SPECIAL_CASES', 'Cancer Survivor', 1, '/cancer-survivor-matrimony-matrimonials', 'Y', 'L1_SP_1415', 'A Cancer Survivor has seen the worst period of life. Millions around the world have overcome cancer with medical treatment. They now want to start life afresh and getting married is certainly one of them. Cancer Survivor Matrimony is noble idea for many. With the perfect partner, life''s journey becomes a smooth one. Find cancer survivor partners ready for matrimonial alliance.', 'Cancer Survivor Matrimony - Cancer Survivor Matrimonial - Cancer Survivor Matrimonials - Cancer Survivor Marriage - Online Cancer Survivor Matrimonials - Matrimonial Services', 'Search Cancer Survivor Matrimony, Cancer Survivor Matrimonial, Cancer Survivor Matrimonials, Cancer Survivor Marriage, Cancer Survivor Matrimonial Profiles in the leading Cancer Survivor Matrimonials site for Indian and NRI Cancer Survivor Marriage. Join Free & Add your Cancer Survivor Matrimonial Profile Now! Find suitable Indian & NRI Cancer Survivor brides and grooms from our online Cancer Survivor matrimonial and matchmaking services.', 'Cancer Survivor matrimony, Cancer Survivor matrimonials, Cancer Survivor matrimonial, matrimonials, matrimony, matrimony services, online Cancer Survivor matrimonials, Indian marriage, match making, matchmaker, Cancer Survivor profiles, marriage bureau , Cancer Survivor marriage bureau, matchmaking services, matrimonial profiles, Cancer Survivor bride, Cancer Survivor groom, matrimony classified, brides, grooms', 'Cancer Survivor Matrimonials', 'Y', 'cancer-survivor-matrimonials.jpg', 'Cancer Survivor Matrimony', 'N');
INSERT INTO `COMMUNITY_PAGES` VALUES (1414, 'Handicapped', '', 'SPECIAL_CASES', 'Handicapped', 1, '/handicapped-matrimony-matrimonials', 'Y', 'L1_SP_1414', 'A person with a physical disability because of illness or accident is termed as \'Handicapped\'. These people get government assistance to start income generating activities. Even the Handicapped persons, just like healthy persons, want to share their joys and sorrows with someone special. Handicapped Matrimony is a dignified gesture, as people with physical disability wants to tie the nuptial knot and lead a happy life. This platform unites likeminded persons for physically challenged matrimony. ', 'Handicapped Matrimony - Handicapped Matrimonial - Physically challenged Matrimonials - Physically challenged Marriage - Online Handicapped Matrimonials - Matrimonial Services', 'Search Handicapped Matrimony, Handicapped Matrimonial, Physically challenged Matrimonials, Physically challenged Marriage, Cripple Matrimonial Profiles in the leading Handicapped Matrimonials site for Indian and NRI Handicapped Marriage. Join Free & Add your Handicapped Matrimonial Profile Now! Find suitable Indian & NRI Handicapped brides and grooms from our online Handicapped matrimonial and matchmaking services.', 'Handicapped matrimony, Handicapped matrimonials, Physically challenged matrimonial, matrimonials, matrimony, matrimony services, online Physically challenged matrimonials, Indian marriage, match making, matchmaker, Cripple profiles, marriage bureau , Handicapped marriage bureau, matchmaking services, matrimonial profiles, Handicapped bride, Handicapped groom, matrimony classified, brides, grooms', 'Handicapped Matrimonials', 'Y', 'handicapped-matrimonials.jpg', 'Handicapped Matrimony', 'N');
INSERT INTO `COMMUNITY_PAGES` VALUES (1412, 'Speech Impaired', '', 'SPECIAL_CASES', 'Dumb', 1, '/dumb-matrimony-matrimonials', 'Y', 'L1_SP_1412', 'Out of 5% of Indian population which is suffering from speaking disorders, a large population is mute or speaking impaired. Dumb matrimony in India is not that impossible concern as it is not any infectious disease and people generally lead a normal life. The matrimonial alliances between deaf and dumb people have been successful as they can complement each other\'s disability or problems and provide their support. They can communicate in sign languages and understand each other\'s emotions well', 'Dumb Matrimony - Dumb Matrimonial - Dumb Matrimonials - Dumb Marriage - Online Dumb Matrimonials - Matrimonial Services', 'Search Dumb Matrimony, Dumb Matrimonial, Dumb Matrimonials, Dumb Marriage, Dumb Matrimonial Profiles in the leading Dumb Matrimonials site for Indian and NRI Dumb Marriage. Join Free & Add your Dumb Matrimonial Profile Now! Find suitable Indian & NRI Dumb brides and grooms from our online Dumb matrimonial and matchmaking services.', 'Dumb matrimony, Dumb matrimonials, Dumb matrimonial, matrimonials, matrimony, matrimony services, online Dumb matrimonials, Indian marriage, match making, matchmaker, Dumb profiles, marriage bureau , Dumb marriage bureau, matchmaking services, matrimonial profiles, Dumb bride, Dumb groom, matrimony classified, brides, grooms', 'Dumb Matrimonials', 'Y', 'dumb-matrimonials.jpg', 'Dumb Matrimony', 'N');
INSERT INTO `COMMUNITY_PAGES` VALUES (1413, 'Visually Impaired', '', 'SPECIAL_CASES', 'Blind', 1, '/blind-matrimony-matrimonials', 'Y', 'L1_SP_1413', 'The data of visually impaired people in India is shocking as out of every 3 such people, 1 belongs to India. The marriages are quite tough to arrange and it is important that one of the partners should be able to see as the blind people need extra care which only a life partner can do. There are matrimony sites for blind people that can help to seek them most suitable matches. Blind matrimony is really a noble thing and people can change their lives by finding the perfect match', 'Blind Matrimony - Blind Matrimonial - Blind Matrimonials - Blind Marriage - Online Blind Matrimonials - Matrimonial Services', 'Search Blind Matrimony, Blind Matrimonial, Blind Matrimonials, Blind Marriage, Blind Matrimonial Profiles in the leading Blind Matrimonials site for Indian and NRI Blind Marriage. Join Free & Add your Blind Matrimonial Profile Now! Find suitable Indian & NRI Blind brides and grooms from our online Blind matrimonial and matchmaking services.', 'Blind matrimony, Blind matrimonials, Blind matrimonial, matrimonials, matrimony, matrimony services, online Blind matrimonials, Indian marriage, match making, matchmaker, Blind profiles, marriage bureau , Blind marriage bureau, matchmaking services, matrimonial profiles, Blind bride, Blind groom, matrimony classified, brides, grooms', 'Blind Matrimonials', 'Y', 'blind-matrimonials.jpg', 'Blind Matrimony', 'N');
INSERT INTO `COMMUNITY_PAGES` VALUES (1411, 'Hearing Impaired', '', 'SPECIAL_CASES', 'Deaf', 1, '/deaf-matrimony-matrimonials', 'Y', 'L1_SP_1411', 'In India, there are more than 3 million deaf (Hearing Impaired) people. Deafness is no infectious disease and they also deserve to lead a normal life like others. Among the large population of deaf and dumb in India, many of them are still unmarried and can form perfect matches for each other as they will understand each other\'s emotions and problems well. Deaf matrimony is all about uniting two people who can complement each other\'s life well and make life easy', 'Deaf Matrimony - Deaf Matrimonial - Deaf Matrimonials - Deaf Marriage - Online Deaf Matrimonials - Matrimonial Services', 'Search Deaf Matrimony, Deaf Matrimonial, Deaf Matrimonials, Deaf Marriage, Deaf Matrimonial Profiles in the leading Deaf Matrimonials site for Indian and NRI Deaf Marriage. Join Free &amp; Add your Deaf Matrimonial Profile Now! Find suitable Indian &amp; NRI Deaf brides and grooms from our online Deaf matrimonial and matchmaking services.', 'Deaf matrimony, Deaf matrimonials, Deaf matrimonial, matrimonials, matrimony, matrimony services, online Deaf matrimonials, Indian marriage, match making, matchmaker, Deaf profiles, marriage bureau , Deaf marriage bureau, matchmaking services, matrimonial profiles, Deaf bride, Deaf groom, matrimony classified, brides, grooms', 'Deaf Matrimonials', 'Y', 'deaf-matrimonials.jpg', 'Deaf Matrimony', 'N');
INSERT INTO `COMMUNITY_PAGES` VALUES (1409, 'HIV Positive', '', 'SPECIAL_CASES', 'HIV', 1, '/hiv-positive-matrimony-matrimonials', 'Y', 'L1_SP_1409', 'At some stage, the life demands someone as a partner to share both happy and sad moments. Approximately 1.4-1.6 million people in India are HIV positive and among which many of them are still unmarried. It is definitely a noble thought to unite two souls who are suffering with the same problem. Being HIV positive does not mean that the the life is about to end. There is still way long and HIV positive matrimony can definitely bring happiness to the lives of HIV positive people', 'HIV Positive Matrimony - HIV Positive Matrimonial - HIV Positive Matrimonials - HIV Positive Marriage - Online HIV Positive Matrimonials - Matrimonial Services', 'Search HIV Positive Matrimony, HIV Positive Matrimonial, HIV Positive Matrimonials, HIV Positive Marriage, HIV Positive Matrimonial Profiles in the leading HIV Positive Matrimonials site for Indian and NRI HIV Positive Marriage. Join Free & Add your HIV Positive Matrimonial Profile Now! Find suitable Indian & NRI HIV Positive brides and grooms from our online HIV Positive matrimonial and matchmaking services.', 'HIV Positive matrimony, HIV Positive matrimonials, HIV Positive matrimonial, matrimonials, matrimony, matrimony services, online HIV Positive matrimonials, Indian marriage, match making, matchmaker, HIV Positive profiles, marriage bureau , HIV Positive marriage bureau, matchmaking services, matrimonial profiles, HIV Positive bride, HIV Positive groom, matrimony classified, brides, grooms', 'HIV positive Matrimonials ', 'Y', 'hiv-positive-matrimonials.jpg', 'HIV positive Matrimony', 'N');
INSERT INTO `COMMUNITY_PAGES` VALUES (1410, 'Thalassemia Major', '', 'SPECIAL_CASES', 'Thalassemia', 1, '/thalassemia-major-matrimony-matrimonials', 'Y', 'L1_SP_1410', 'Thalassemia Major is a blood disorder, where the people suffer from insufficient hemoglobin. It is not an infectious disease as believed by many. A person suffering from Thalassemic Major is equally eligible to get married & live happily. Only 3-4% of the Indian population suffers from Thalassemic and since the number is less, it\'s tough to find the suitable match. It would be a wise decision to search for the perfect match on the online matrimonial sites that assure Thalassemia Major Matrimony', 'Thalassemia Major Matrimony - Thalassemic Major Matrimonial - Thalassemia Major Matrimonials - Thalassemia Major Marriage - Online Thalassemia Major Matrimonials - Matrimonial Services', 'Search Thalassemia Major Matrimony, Thalassemia Major Matrimonial, Thalassemic Major Matrimonials, Thalassemia Major Marriage, Thalassemic Major Matrimonial Profiles in the leading Thalassemia Major Matrimonials site for Indian and NRI Thalassemia Major Marriage. Join Free & Add your Thalassemia Major Matrimonial Profile Now! Find suitable Indian & NRI Thalassemia Major brides and grooms from our online Thalassemia Major matrimonial and matchmaking services.', 'Thalassemia Major matrimony, Thalassemic Major matrimonials, Thalassemic Major matrimonial, matrimonials, matrimony, matrimony services, online Thalassemic Major matrimonials, Indian marriage, match making, matchmaker, Thalassemia Major profiles, marriage bureau , Thalassemia Major marriage bureau, matchmaking services, matrimonial profiles, Thalassemia Major bride, Thalassemia Major groom, matrimony classified, brides, grooms', 'Thalassemia Major Matrimonials', 'Y', 'Thalassemia-major-matrimonials.jpg', 'Thalassemia Major Matrimony', 'N');
